import logo from './logo.svg';
import './App.css';

function App() {
 const mobile={
  model:'iphone 15', company:'apple', price:'200000'
 }

 const mobilearray=[ 
   {
    model:'iphone 15', company:'Apple', price:'200,000'
   } ,
   {
    model:'Galaxy S24', company:'Samsung', price:'97,000'
   } ,
   {
    model:'One Plus 11', company:'One plus', price:'64,600'
   } 
]




return (
    <div> 
    <h3>Mobile Details</h3>
    <div>Model: {mobile.model}</div>
    <div>Company: {mobile.company}</div>
    <div>Price: {mobile.price}</div>

    <h3>Array of Mobile Details</h3>
    <div>{
        mobilearray.map((mobile)=>{
            return <div>
                 <div>Model: {mobile.model}</div>
    <div>Company: {mobile.company}</div>
    <div>Price: {mobile.price}</div><></>
            </div>            
        })
        }</div>


  </div>


)

}

export default App;
